import React from 'react'
import Form from './../components/Form'
import ListTable from '../components/ListTable'
import {Layout} from 'antd'


class Home extends React.Component {

    

    constructor(props){
        super(props)
        this.state = {
            list : []
        }
    }

    onChange = objectForm => {
        var {list} =this.state
        // list.push({
        //     ...objectForm,
        //     key : list.length
        // })
        this.setState({
            list : list
        })
     
    }
  

    render() {
        var {list}= this.state

        return (
            <Layout>
                <Form onChange={this.onChange}/>
                <ListTable data = {list}/>
            </Layout>

        )
    }
}

export default Home
